import React from "react";
import "./Card.css";

const Card = props => (
  <div className="col-4">
    <div className="card" draggable="true">
        <div className="img-container">
        <img alt={props.name} src={props.image} />
        </div>
        <button type="button" class="btn btn-primary" onclick={ () => props.charactersClicked(props.clicked)}>Click me!</button>
    </div>
  </div>  

);

export default Card;
